import React from 'react';
import BackgroundImg from '../commons/images/future-medicine.jpg';

import {Button, Form, FormGroup, Label, Input, Container, Jumbotron} from 'reactstrap';


const backgroundStyle = {
    backgroundPosition: 'center',
    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
    width: "100%",
    height: "1920px",
    backgroundImage: `url(${BackgroundImg})`
};
const textStyle = {color: 'white', textAlign:'center'};

const loginForm = {
    width: "100%",
    maxWidth: "330px",
    padding: "15px",
    margin: "auto",
    height: "25%",
    backgroundColor: "#708090"
};

const button = {
    width: "40%",
    textAlign: "center",
    height: "25%",
    backgroundColor: "black"
};

class Home extends React.Component {


    render() {

        return (
            <Jumbotron fluid style={backgroundStyle}>
                <Form className="login-form" style={loginForm}>

                    <Container fluid>
                        <h1 className="display-3" style={textStyle}>Login</h1><br/><br/>

                        <FormGroup>
                            <Label>Username</Label>
                            <Input type={"text"}/>
                        </FormGroup>

                        <FormGroup>
                            <Label>Password</Label>
                            <Input type={"password"}/>
                        </FormGroup>
                        <Button style={button}>Login</Button>
                    </Container>


                </Form>
            </Jumbotron>
        )
    };
}

export default Home
